import React, { Children, useState } from "react";
interface Props {
  children: String;
}

const Boutton = ({ children }: Props) => {
  return (
    <div>
      <button className="Bout">{children}</button>
    </div>
  );
};

const Todo = ({ children }: Props) => {
  <ul class="list-group">
    <li class="list-group-item">
      <input
        class="form-check-input me-1"
        type="checkbox"
        value=""
        id="firstCheckboxStretched"
      />
      <label
        class="form-check-label stretched-link"
        for="firstCheckboxStretched"
      >
        {children}
      </label>
    </li>
  </ul>;
};

const TodoForm = () => {
  const [imput, setimput] = useState("");

  const handle = (e) => {
    e.preventDefault();
  };
  return (
    <div>
      <form className="Todo-form" onSubmit={handle}>
        <input
          className="Todo-imput"
          type="text"
          placeholder="add new task"
          name="text"
          value={imput}
        />
        <Boutton>submit</Boutton>
        <Todo>tashe </Todo>
      </form>
    </div>
  );
};

export default TodoForm;
